package io.github.arrayv.sorts.distribute;

import io.github.arrayv.main.ArrayVisualizer;
import io.github.arrayv.sorts.templates.BogoSorting;

public final class CheatBogoSort extends BogoSorting {
    public CheatBogoSort(ArrayVisualizer arrayVisualizer) {
        super(arrayVisualizer);

        this.setSortListName("Cheating Bogo");
        this.setRunAllSortsName("Cheating Bogo Sort");
        this.setRunSortName("Cheating Bogo Sort");
        this.setCategory("Impractical Sorts");
        this.setBucketSort(false);
        this.setRadixSort(false);
        this.setUnreasonablySlow(true);
        this.setUnreasonableLimit(512);
        this.setBogoSort(true);
    }

    private int partition(int[] array, int lo, int hi) {
        int pivot = array[hi];
        int i = lo;

        for(int j = lo; j < hi; j++) {
            Highlights.markArray(1, j);
            if(Reads.compareValues(array[j], pivot) < 0) {
                Writes.swap(array, i, j, 1, true, false);
                i++;
            }
            Delays.sleep(1);
        }
        Writes.swap(array, i, hi, 1, true, false);
        return i;
    }

    private void quickSort(int[] array, int lo, int hi) {
        if(lo < hi) {
            int p = this.partition(array, lo, hi);
            this.quickSort(array, lo, p - 1);
            this.quickSort(array, p + 1, hi);
        }
    }

    @Override
    public void runSort(int[] array, int length, int bucketCount) {
        int[] x = Writes.createExternalArray(length);
        int min = array[0], max = array[0];
        for(int i = 1; i < length; i++) {
            if(array[i] < min) min = array[i];
        }
        for(int i = 0; i < length; i++) {
			Writes.write(x, i, array[i]-min, 0, true, true);
		}
        this.quickSort(x, 0, length - 1);
        int oof = 0;
        while(oof < length)
        if (Reads.compareValues(array[oof], x[oof]) == 0){
                    oof = oof + 1;
                }
            else {
            this.bogoSwap(array, oof, length, false);
                }
        Writes.deleteExternalArray(x);
    }
}

package project;

import org.apache.commons.math3.analysis.function.Log;
import org.apache.commons.math3.analysis.function.Sqrt;
import org.apache.commons.math3.util.CombinatoricsUtils;

import javax.swing.*;

import java.awt.*;
import java.awt.event.ActionEvent;
import java.awt.event.ActionListener;

public class AdvancedCalculator extends JFrame {

    private JTextField display;
    private String currentInput;
    private double result;
    private String lastMathFunction;

    public AdvancedCalculator() {
        currentInput = "";
        result = 0.0;
        lastMathFunction = "";

        display = new JTextField(20);
        display.setEditable(false);

        JButton[] numberButtons = new JButton[10];
        for (int i = 0; i < 10; i++) {
            numberButtons[i] = new JButton(String.valueOf(i));
            int finalI = i;
            numberButtons[i].addActionListener(e -> appendToDisplay(String.valueOf(finalI)));
        }

        JButton addButton = createOperationButton("+");
        JButton subtractButton = createOperationButton("-");
        JButton multiplyButton = createOperationButton("*");
        JButton divideButton = createOperationButton("/");
        JButton percentButton = createOperationButton("%");
        JButton clearButton = new JButton("C");
        clearButton.addActionListener(e -> clear());
        JButton decimalButton = new JButton(".");
        decimalButton.addActionListener(e -> addDecimal());
        JButton removeButton = new JButton("←"); // Button to remove a single entry
        removeButton.addActionListener(e -> removeEntry());
        JButton powerOffButton = new JButton("Power Off");
        powerOffButton.addActionListener(e -> powerOff());

        JButton sqrtButton = createMathFunctionButton("sqrt");
        JButton invButton = createMathFunctionButton("inv");
        JButton squareButton = createMathFunctionButton("sqr");
        JButton factorialButton = createMathFunctionButton("!");
        JButton cubeButton = createMathFunctionButton("cube");
        JButton logButton = createMathFunctionButton("log");
        JButton sinButton = createMathFunctionButton("sin");
        JButton cosButton = createMathFunctionButton("cos");
        JButton tanButton = createMathFunctionButton("tan");
        JButton cosecButton = createMathFunctionButton("cosec");
        JButton secButton = createMathFunctionButton("sec");
        JButton cotButton = createMathFunctionButton("cot");
        JButton lnButton = createMathFunctionButton("ln");
        JButton eButton = createMathFunctionButton("e");
        JButton πButton = createMathFunctionButton("\u03C0");
        JButton exButton = createMathFunctionButton("e^x");
        JButton Button10 = createMathFunctionButton("10^x");
        

        JPanel buttonPanel = new JPanel();
        buttonPanel.setLayout(new GridLayout(6, 6, 5, 5));

        buttonPanel.add(sinButton);
        buttonPanel.add(cosButton);
        buttonPanel.add(tanButton);
        buttonPanel.add(cosecButton);
        buttonPanel.add(secButton);
        buttonPanel.add(cotButton);

        buttonPanel.add(logButton);
        buttonPanel.add(lnButton);
        buttonPanel.add(clearButton);
        buttonPanel.add(percentButton);
        buttonPanel.add(removeButton);
        buttonPanel.add(invButton);

        buttonPanel.add(πButton);
        buttonPanel.add(numberButtons[1]);
        buttonPanel.add(numberButtons[2]);
        buttonPanel.add(numberButtons[3]);
        buttonPanel.add(addButton);
        buttonPanel.add(squareButton);

        buttonPanel.add(eButton);
        buttonPanel.add(numberButtons[4]);
        buttonPanel.add(numberButtons[5]);
        buttonPanel.add(numberButtons[6]);
        buttonPanel.add(subtractButton);
        buttonPanel.add(sqrtButton);
        


        buttonPanel.add(exButton);
        buttonPanel.add(numberButtons[7]);
        buttonPanel.add(numberButtons[8]);
        buttonPanel.add(numberButtons[9]);
        buttonPanel.add(multiplyButton);
        buttonPanel.add(cubeButton);

        buttonPanel.add(Button10);
        buttonPanel.add(factorialButton);
        buttonPanel.add(numberButtons[0]);
        buttonPanel.add(decimalButton);
        buttonPanel.add(divideButton);
        buttonPanel.add(powerOffButton);


        setLayout(new BorderLayout());
        add(display, BorderLayout.NORTH);
        add(buttonPanel, BorderLayout.CENTER);

        setTitle("Advanced Calculator");
        setDefaultCloseOperation(JFrame.EXIT_ON_CLOSE);
        pack();
        setLocationRelativeTo(null);
        setVisible(true);
    }

    private JButton createOperationButton(String label) {
        JButton button = new JButton(label);
        button.addActionListener(e -> performOperation(label));
        return button;
    }

    private JButton createMathFunctionButton(String functionName) {
        JButton button = new JButton(functionName);
        button.addActionListener(e -> applyMathFunction(functionName));
        return button;
    }

    private void appendToDisplay(String input) {
        currentInput += input;
        display.setText(currentInput);
    }

    private void clear() {
        currentInput = "";
        result = 0.0;
        display.setText("");
    }



    private void performOperation(String operator) {
        if (!currentInput.isEmpty()) {
            double number = Double.parseDouble(currentInput);
            switch (operator) {
                case "+":
                    result += number;
                    break;
                case "-":
                    result -= number;
                    break;
                    case "*":
                    if (result == 0.0) {
                        result = number;
                    } else {
                        result *= number;
                    }
                    break;
                case "/":
                    if (result == 0.0) {
                        result = number;
                    } else {
                        result /= number;
                    }
                    break;
                case "%":
                    result = number / 100;
                    break;
            }
            currentInput = "";
            display.setText(String.valueOf(result));
        }
    }

    private void applyMathFunction(String functionName) {
        if (!currentInput.isEmpty()) {
            double number = Double.parseDouble(currentInput);

            // Check if there is a result from a previous operation
            if (result != 0.0) {
                number = result;
                result = 0.0; // Reset the result for the next operation
            }

            switch (functionName) { 
                case "e":
                    result = 2.71828182845904523536;
                    break;
                case "inv":
                    result = 1/number;
                    break;
                case "π":
                    result = 3.14159265358979323846;
                    break;
                case "sqrt":
                    result = new Sqrt().value(number);
                    break;
                case "sqr":
                    result = Math.pow(number, 2);
                    break;
                case "cube":
                    result = Math.pow(number, 3);
                    break;
                case "e^x":
                    result = Math.pow(2.71828182845904523536, number);
                    break;
                case "10^x":
                    result = Math.pow(10, number);
                    break;
                case "log":
                    result = Math.log(number) / Math.log(10);
                    break;
                case "ln":
                    result = new Log().value(number);
                    break;
                case "sin":
                    result = Math.sin(number * 3.14159265358979323846 / 180);
                    break;
                case "cos":
                    result = Math.cos(number * 3.14159265358979323846 / 180);
                    break;
                case "tan":
                    result = Math.tan(number * 3.14159265358979323846 / 180);
                    break;
                case "cosec":
                    result = 1 / Math.sin(number * 3.14159265358979323846 / 180);
                    break;
                case "sec":
                    result = 1 / Math.cos(number * 3.14159265358979323846 / 180);
                    break;
                case "cot":
                    result = 1 / Math.tan(number * 3.14159265358979323846 / 180);
                    break;
                case "!":
                result = CombinatoricsUtils.factorial((int) number);
                break;
            }
        }
             // Store the last math function for future use
             lastMathFunction = functionName;

             // Update the display with the result
             currentInput = String.valueOf(result);
             display.setText(currentInput);
         }

    private void evaluate() {
        performOperation("");
        currentInput = String.valueOf(result);
    }

    public static void main(String[] args) {
        SwingUtilities.invokeLater(AdvancedCalculator::new);
    }

    private void addDecimal() {
        if (!currentInput.contains(".")) {
            currentInput += ".";
            display.setText(currentInput);
        }
    }

    private void removeEntry() {
        if (!currentInput.isEmpty()) {
            currentInput = currentInput.substring(0, currentInput.length() - 1);
            display.setText(currentInput);
        }
    }

    private void powerOff() {
        int choice = JOptionPane.showConfirmDialog(this, "Are you sure you want to power off?", "Power Off",
                JOptionPane.YES_NO_OPTION, JOptionPane.QUESTION_MESSAGE);
        if (choice == JOptionPane.YES_OPTION) {
            System.exit(0);
        }
    }

}

